import react from 'react';

function NavBar() {
    return (
      <nav class="bg-white border-gray-200 px-2 sm:px-4 py-2.5 rounded dark:bg-gray-800">
        <div class="container flex-center flex-center justify-between mx-auto">
          <span class=" text-xl flex-center font-semibold whitespace-nowrap dark:text-white">BeSpoked</span>
        </div>
      </nav>
    )
}

export default NavBar;
